import React from 'react';
import { View, TouchableOpacity, Text } from 'react-native';
import StyleButtonList from './StyleButtonLIst';
import StyleCentre from '../StyleCenter';



const ButtonList: React.FC<any> = ({ navigation }) => {
    let items: string[] =["Saved message","Look","Notification","Chat folders","Confidentiality","Language",];
    return <View>
    {items.map((item, index) => (
      <View key={index} >
        <TouchableOpacity style={StyleButtonList.buttonConteiner} onPress={() => navigation.navigate(item)}>
          <View style={StyleButtonList.button}></View>
          <Text style={StyleButtonList.buttonTextStyle}>{item}</Text>
        </TouchableOpacity>
      </View>
    ))}
     <Text style= {StyleButtonList.styleButListText}>FAQ</Text>
                                <TouchableOpacity onPress={() => navigation.navigate('Question page')}>
                                        <View style={StyleButtonList.button}></View>
                                        <Text style = {StyleButtonList.buttonTextStyle}>Question in Telintik</Text>
                                </TouchableOpacity>
                                    <TouchableOpacity  onPress={() => navigation.navigate('Ask a question')}>
                                      <View style={StyleButtonList.button}></View>
                                      <Text style = {StyleButtonList.buttonTextStyle}>Ask a Question</Text>
                                    </TouchableOpacity>
    </View>
}


export default ButtonList;
